func HandlerFromMuxWithBaseURL(si ServerInterface, m ServeMux, baseURL string) http.Handler {
	return HandlerWithOptions(si, StdHTTPServerOptions{
		BaseURL:    baseURL,
		BaseRouter: m,
	})
}

// HandlerWithOptions creates http.Handler with additional options
func HandlerWithOptions(si ServerInterface, options StdHTTPServerOptions) http.Handler {
	m := options.BaseRouter

	if m == nil {
		m = http.NewServeMux()
	}
	if options.ErrorHandlerFunc == nil {
		options.ErrorHandlerFunc = func(w http.ResponseWriter, r *http.Request, err error) {
			http.Error(w, err.Error(), http.StatusBadRequest)
		}
	}

	wrapper := ServerInterfaceWrapper{
		Handler:            si,
		HandlerMiddlewares: options.Middlewares,
		ErrorHandlerFunc:   options.ErrorHandlerFunc,
	}

	m.HandleFunc("GET "+options.BaseURL+"/v2/agents/challenge", wrapper.GetAgentChallenge)
	m.HandleFunc("POST "+options.BaseURL+"/v2/agents/register", wrapper.RegisterAgent)
	m.HandleFunc("POST "+options.BaseURL+"/v2/agents/{agent_id}/deployed", wrapper.AgentDeployed)
	m.HandleFunc("POST "+options.BaseURL+"/v2/agents/{agent_id}/heartbeat", wrapper.AgentHeartbeat)
	m.HandleFunc("POST "+options.BaseURL+"/v2/agents/{agent_id}/status", wrapper.AgentStatus)
	m.HandleFunc("POST "+options.BaseURL+"/v2/apps/{app_name}/versions", wrapper.PublishAppVersion)
	m.HandleFunc("POST "+options.BaseURL+"/v2/apps/{app_name}/versions/{version}/deploy", wrapper.DeployVersion)
	m.HandleFunc("POST "+options.BaseURL+"/v2/apps/{app_name}/versions/{version}/deploy/preflight", wrapper.DeployPreflight)
	m.HandleFunc("GET "+options.BaseURL+"/v2/federation/datacenters/{dc_id}/desired-state", wrapper.GetDatacenterDesiredState)
	m.HandleFunc("POST "+options.BaseURL+"/v2/federation/datacenters/{dc_id}/events", wrapper.PostDatacenterEvents)
	m.HandleFunc("POST "+options.BaseURL+"/v2/federation/datacenters/{dc_id}/snapshot", wrapper.PostDatacenterSnapshot)
	m.HandleFunc("GET "+options.BaseURL+"/v2/health", wrapper.GetControlPlaneHealth)

	return m
}

